import React, { useEffect, useState } from 'react';
import Topbar from '../components/Topbar';
import { Box, Typography, Button, List, ListItem, ListItemText, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';
import { useNavigate, useParams } from 'react-router-dom';
import axios from 'axios';

function Operacoes() {
  const navigate = useNavigate();
  const { clienteId } = useParams();
  const [operacoes, setOperacoes] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/operacoes')
      .then(res => setOperacoes(res.data))
      .catch(() => setOperacoes([]));
  }, []);

  const operacoesCliente = operacoes.filter(op => op.cliente_id === clienteId);

  const handleLogout = () => {
    localStorage.removeItem('neofi_auth');
    navigate('/');
  };

  return (
    <Box>
      <Topbar />
      <Box sx={{ display: 'flex', height: 'calc(100vh - 64px)' }}>
        {/* Menu lateral */}
        <Box sx={{ width: 250, bgcolor: '#fafafa', borderRight: '1px solid #eee', p: 2 }}>
          <Typography variant="subtitle1" sx={{ mb: 2, fontWeight: 'bold' }}>ADICIONAR MOVIMENTAÇÃO</Typography>
          <List>
            <ListItem button>
              <ListItemText primary="DÍVIDA" />
            </ListItem>
            <ListItem button>
              <ListItemText primary="RENDA FIXA ENOR" />
            </ListItem>
            <ListItem button>
              <ListItemText primary="AAVE" />
            </ListItem>
            <ListItem button>
              <ListItemText primary="IMÓVEL" />
            </ListItem>
          </List>
        </Box>
        {/* Painel principal */}
        <Box sx={{ flex: 1, bgcolor: '#aaa', display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          {operacoesCliente.length === 0 ? (
            <Typography variant="h6" color="#fff" align="center">
              Nenhuma operação encontrada para este cliente.
            </Typography>
          ) : (
            <TableContainer component={Paper} sx={{ maxWidth: 800 }}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell>Tipo</TableCell>
                    <TableCell>Valor</TableCell>
                    <TableCell>Status</TableCell>
                    <TableCell>Data Início</TableCell>
                    <TableCell>Data Fim</TableCell>
                    <TableCell>Observação</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {operacoesCliente.map((op) => (
                    <TableRow key={op.id}>
                      <TableCell>{op.tipo}</TableCell>
                      <TableCell>{op.valor}</TableCell>
                      <TableCell>{op.status}</TableCell>
                      <TableCell>{op.data_inicio ? new Date(op.data_inicio).toLocaleString('pt-BR') : ''}</TableCell>
                      <TableCell>{op.data_fim ? new Date(op.data_fim).toLocaleString('pt-BR') : ''}</TableCell>
                      <TableCell>{op.observacao}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </Box>
      </Box>
    </Box>
  );
}

export default Operacoes;
